INSERT INTO `document` (`DocID`, `Title`, `Author`, `Publisher`, `PublishYear`, `Quantity`, `Tags`, `Visited`, `thesis`, `ISBN`, `Votes`, `Score`, `Cover`, `Description`) VALUES
(1, 'Harry Potter and the Sorcerer\'s Stone', 'J.K. Rowling', 'Pottermore Publishing', 2015, 0, 'Juvenile Fiction', 0, 0, '9781781100486', 0, 0, , 'Turning the envelope over, his hand trembling, Harry saw a purple wax seal bearing a coat of arms; a lion, an eagle, a badger and a snake surrounding a large letter \'H\'. Harry Potter has never even heard of Hogwarts when the letters start dropping on the doormat at number four, Privet Drive. Addressed in green ink on yellowish parchment with a purple seal, they are swiftly confiscated by his grisly aunt and uncle. Then, on Harry\'s eleventh birthday, a great beetle-eyed giant of a man called Rubeus Hagrid bursts in with some astonishing news: Harry Potter is a wizard, and he has a place at Hogwarts School of Witchcraft and Wizardry. An incredible adventure is about to begin! Having become classics of our time, the Harry Potter eBooks never fail to bring comfort and escapism. With their message of hope, belonging and the enduring power of truth and love, the story of the Boy Who Lived continues to delight generations of new readers.');
INSERT INTO `document` (`DocID`, `Title`, `Author`, `Publisher`, `PublishYear`, `Quantity`, `Tags`, `Visited`, `thesis`, `ISBN`, `Votes`, `Score`, `Cover`, `Description`) VALUES
(2, 'Atomic Habits', 'James Clear', 'Penguin', 2018, 0, 'Business & Economics', 0, 0, '9780735211292', 0, 0, , 'The #1 New York Times bestseller. Over 20 million copies sold! Translated into 60+ languages! Tiny Changes, Remarkable Results No matter your goals, Atomic Habits offers a proven framework for improving--every day. James Clear, one of the world\'s leading experts on habit formation, reveals practical strategies that will teach you exactly how to form good habits, break bad ones, and master the tiny behaviors that lead to remarkable results. If you\'re having trouble changing your habits, the problem isn\'t you. The problem is your system. Bad habits repeat themselves again and again not because you don\'t want to change, but because you have the wrong system for change. You do not rise to the level of your goals. You fall to the level of your systems. Here, you\'ll get a proven system that can take you to new heights. Clear is known for his ability to distill complex topics into simple behaviors that can be easily applied to daily life and work. Here, he draws on the most proven ideas from biology, psychology, and neuroscience to create an easy-to-understand guide for making good habits inevitable and bad habits impossible. Along the way, readers will be inspired and entertained with true stories from Olympic gold medalists, award-winning artists, business leaders, life-saving physicians, and star comedians who have used the science of small habits to master their craft and vault to the top of their field. Learn how to: make time for new habits (even when life gets crazy); overcome a lack of motivation and willpower; design your environment to make success easier; get back on track when you fall off course; ...and much more. Atomic Habits will reshape the way you think about progress and success, and give you the tools and strategies you need to transform your habits--whether you are a team looking to win a championship, an organization hoping to redefine an industry, or simply an individual who wishes to quit smoking, lose weight, reduce stress, or achieve any other goal.');
INSERT INTO `document` (`DocID`, `Title`, `Author`, `Publisher`, `PublishYear`, `Quantity`, `Tags`, `Visited`, `thesis`, `ISBN`, `Votes`, `Score`, `Cover`, `Description`) VALUES
(3, 'Harry Potter and the Chamber of Secrets', 'J.K. Rowling', 'Pottermore Publishing', 2015, 0, 'Fiction', 0, 0, '9781781100509', 0, 0, , '\'There is a plot, Harry Potter. A plot to make most terrible things happen at Hogwarts School of Witchcraft and Wizardry this year.\' Harry Potter\'s summer has included the worst birthday ever, doomy warnings from a house-elf called Dobby, and rescue from the Dursleys by his friend Ron Weasley in a magical flying car! Back at Hogwarts School of Witchcraft and Wizardry for his second year, Harry hears strange whispers echo through empty corridors - and then the attacks start. Students are found as though turned to stone... Dobby\'s sinister predictions seem to be coming true. Having become classics of our time, the Harry Potter eBooks never fail to bring comfort and escapism. With their message of hope, belonging and the enduring power of truth and love, the story of the Boy Who Lived continues to delight generations of new readers.');
INSERT INTO `document` (`DocID`, `Title`, `Author`, `Publisher`, `PublishYear`, `Quantity`, `Tags`, `Visited`, `thesis`, `ISBN`, `Votes`, `Score`, `Cover`, `Description`) VALUES
(4, 'Harry Potter and the Order of the Phoenix', 'J.K. Rowling', 'Pottermore Publishing', 2015, 0, 'Fiction', 0, 0, '9781781100530', 0, 0, , '\'You are sharing the Dark Lord\'s thoughts and emotions. The Headmaster thinks it inadvisable for this to continue. He wishes me to teach you how to close your mind to the Dark Lord.\' Dark times have come to Hogwarts. After the Dementors\' attack on his cousin Dudley, Harry Potter knows that Voldemort will stop at nothing to find him. There are many who deny the Dark Lord\'s return, but Harry is not alone: a secret order gathers at Grimmauld Place to fight against the Dark forces. Harry must allow Professor Snape to teach him how to protect himself from Voldemort\'s savage assaults on his mind. But they are growing stronger by the day and Harry is running out of time... Having become classics of our time, the Harry Potter eBooks never fail to bring comfort and escapism. With their message of hope, belonging and the enduring power of truth and love, the story of the Boy Who Lived continues to delight generations of new readers.');
INSERT INTO `document` (`DocID`, `Title`, `Author`, `Publisher`, `PublishYear`, `Quantity`, `Tags`, `Visited`, `thesis`, `ISBN`, `Votes`, `Score`, `Cover`, `Description`) VALUES
(5, 'Harry Potter and the Order of the Phoenix', 'J.K. Rowling', 'Pottermore Publishing', 2015, 0, 'Fiction', 0, 0, '9781781100530', 0, 0, , '\'You are sharing the Dark Lord\'s thoughts and emotions. The Headmaster thinks it inadvisable for this to continue. He wishes me to teach you how to close your mind to the Dark Lord.\' Dark times have come to Hogwarts. After the Dementors\' attack on his cousin Dudley, Harry Potter knows that Voldemort will stop at nothing to find him. There are many who deny the Dark Lord\'s return, but Harry is not alone: a secret order gathers at Grimmauld Place to fight against the Dark forces. Harry must allow Professor Snape to teach him how to protect himself from Voldemort\'s savage assaults on his mind. But they are growing stronger by the day and Harry is running out of time... Having become classics of our time, the Harry Potter eBooks never fail to bring comfort and escapism. With their message of hope, belonging and the enduring power of truth and love, the story of the Boy Who Lived continues to delight generations of new readers.');
INSERT INTO `document` (`DocID`, `Title`, `Author`, `Publisher`, `PublishYear`, `Quantity`, `Tags`, `Visited`, `thesis`, `ISBN`, `Votes`, `Score`, `Cover`, `Description`) VALUES
(6, 'Harry Potter and the Deathly Hallows', 'J.K. Rowling', 'Pottermore Publishing', 2015, 0, 'Juvenile Fiction', 0, 0, '9781781102435', 0, 0, , '\'Give me Harry Potter,\' said Voldemort\'s voice, \'and none shall be harmed. Give me Harry Potter, and I shall leave the school untouched. Give me Harry Potter, and you will be rewarded.\' As he climbs into the sidecar of Hagrid\'s motorbike and takes to the skies, leaving Privet Drive for the last time, Harry Potter knows that Lord Voldemort and the Death Eaters are not far behind. The protective charm that has kept Harry safe until now is broken, but he cannot keep hiding. The Dark Lord is breathing fear into everything Harry loves and to stop him Harry will have to find and destroy the remaining Horcruxes. The final battle must begin - Harry must stand and face his enemy... Having become classics of our time, the Harry Potter eBooks never fail to bring comfort and escapism. With their message of hope, belonging and the enduring power of truth and love, the story of the Boy Who Lived continues to delight generations of new readers.');
INSERT INTO `document` (`DocID`, `Title`, `Author`, `Publisher`, `PublishYear`, `Quantity`, `Tags`, `Visited`, `thesis`, `ISBN`, `Votes`, `Score`, `Cover`, `Description`) VALUES
(7, 'Harry Potter and the Half-Blood Prince', 'J.K. Rowling', 'Pottermore Publishing', 2015, 0, 'Fiction', 0, 0, '9781781100547', 0, 0, , 'There it was, hanging in the sky above the school: the blazing green skull with a serpent tongue, the mark Death Eaters left behind whenever they had entered a building... wherever they had murdered... When Dumbledore arrives at Privet Drive one summer night to collect Harry Potter, his wand hand is blackened and shrivelled, but he does not reveal why. Secrets and suspicion are spreading through the wizarding world, and Hogwarts itself is not safe. Harry is convinced that Malfoy bears the Dark Mark: there is a Death Eater amongst them. Harry will need powerful magic and true friends as he explores Voldemort\'s darkest secrets, and Dumbledore prepares him to face his destiny... Having become classics of our time, the Harry Potter eBooks never fail to bring comfort and escapism. With their message of hope, belonging and the enduring power of truth and love, the story of the Boy Who Lived continues to delight generations of new readers.');
INSERT INTO `document` (`DocID`, `Title`, `Author`, `Publisher`, `PublishYear`, `Quantity`, `Tags`, `Visited`, `thesis`, `ISBN`, `Votes`, `Score`, `Cover`, `Description`) VALUES
(8, 'From the World of Percy Jackson: The Sun and the Star', 'Rick Riordan, Mark Oshiro', 'National Geographic Books', 2023, 0, 'Juvenile Fiction', 0, 0, '9781368081153', 0, 0, , 'Demigods Nico di Angelo and Will Solace must endure the terrors of Tartarus to rescue an old friend in this thrilling adventure co-written by New York Times #1 best-selling author Rick Riordan and award-winning author Mark Oshiro. Percy Jackson fans, rejoice! Nico and Will have a book of their own! As the son of Hades, Nico di Angelo has been through so much, from the premature deaths of his mother and sister, to being outed against his will, to losing his friend Jason during the trials of Apollo. But there is a ray of sunshine in his life—literally: his boyfriend, Will Solace, the son of Apollo. Together the two demigods can overcome any obstacle or foe. At least, that\'s been the case so far... Now Nico is being plagued by a voice calling out to him from Tartarus, the lowest part of the Underworld. He thinks he knows who it is: a reformed Titan named Bob whom Percy and Annabeth had to leave behind when they escaped Hades\'s realm. Nico\'s dreams and Rachel Dare\'s latest prophecy leave little doubt in Nico\'s mind that Bob is in some kind of trouble. Nico has to go on this quest, whether Mr. D and Chiron like it or not. And of course Will insists on coming with. But can a being made of light survive in the darkest part of the world? and what does the prophecy mean that Nico will have to \"leave something of equal value behind?\" Nico will have to face demons both internal and external as his relationship with Will is tested to the core in this standalone adventure featuring two of the most popular characters in the Percy Jackson saga. Complete your Nico di Angelo collection with these series by Rick Riordan: Percy Jackson and the Olympians • The Heroes of Olympus • The Trials of Apollo');
INSERT INTO `document` (`DocID`, `Title`, `Author`, `Publisher`, `PublishYear`, `Quantity`, `Tags`, `Visited`, `thesis`, `ISBN`, `Votes`, `Score`, `Cover`, `Description`) VALUES
(9, 'Percy Jackson and the Olympians, Book Four: The Battle of the Labyrinth', 'Rick Riordan', 'Disney Electronic Content', 2009, 0, 'Juvenile Fiction', 0, 0, '9781423131984', 0, 0, , 'Percy Jackson isn\'t expecting freshman orientation to be any fun. But when a mysterious mortal acquaintance appears on campus, followed by demon cheerleaders, things quickly move from bad to diabolical. In this latest installment of the blockbuster series, time is running out as war between the Olympians and the evil Titan lord Kronos draws near.');
INSERT INTO `document` (`DocID`, `Title`, `Author`, `Publisher`, `PublishYear`, `Quantity`, `Tags`, `Visited`, `thesis`, `ISBN`, `Votes`, `Score`, `Cover`, `Description`) VALUES
(10, 'Diper Överlöde (Diary of a Wimpy Kid Book 17)', 'Jeff Kinney', NULL, 2022, 0, 'Juvenile Fiction', 0, 0, '9781419762949', 0, 0, , 'In Diper Överlöde, book 17 of the Diary of a Wimpy Kid series from #1 international bestselling author Jeff Kinney, Greg Heffley is finding out that the road to fame and glory comes with some hard knocks. When he decides to tag along with his brother Rodrick\'s band, Löded Diper, Greg doesn\'t realize what he\'s getting into. But he soon learns that late nights, unpaid gigs, fighting between band members, and money troubles are all part of the rock \'n\' roll lifestyle. Can Greg help Löded Diper become the legends they think they are? Or will too much time with Rodrick\'s band be a diper överlöde?');
INSERT INTO `document` (`DocID`, `Title`, `Author`, `Publisher`, `PublishYear`, `Quantity`, `Tags`, `Visited`, `thesis`, `ISBN`, `Votes`, `Score`, `Cover`, `Description`) VALUES
(11, 'Double Down (Diary of a Wimpy Kid #11)', 'Jeff Kinney', 'Amulet Books', 2016, 0, 'Juvenile Fiction', 0, 0, '9781419741975', 0, 0, , 'The pressure\'s really piling up on Greg Heffley. His mom thinks video games are turning his brain to mush, so she wants her son to put down the controller and explore his \"creative side.\" As if that\'s not scary enough, Halloween\'s just around the corner and the frights are coming at Greg from every angle. When Greg discovers a bag of gummy worms, it sparks an idea. Can he get his mom off his back by making a movie . . . and will he become rich and famous in the process? Or will doubling down on this plan just double Greg\'s troubles?');
INSERT INTO `document` (`DocID`, `Title`, `Author`, `Publisher`, `PublishYear`, `Quantity`, `Tags`, `Visited`, `thesis`, `ISBN`, `Votes`, `Score`, `Cover`, `Description`) VALUES
(12, 'Superman: Red Son (New Edition)', 'Mark Millar', 'DC Comics', 2014, 0, 'Comics & Graphic Novels', 0, 0, '9781401252229', 0, 0, , 'Imagine a reality where the world’s most powerful super-being does not grow up in Smallville, Kansas - or even America, for that matter…: RED SON is a vivid tale of Cold War paranoia, that reveals how the ship carrying the infant who would later be known as Superman lands in the midst of the 1950s Soviet Union. Raised on a collective, the infant grows up and becomes a symbol to the Soviet people, and the world changes drastically from what we know - bringing Superman into conflict with Batman, Lex Luthor and many others. From the mind of Mark Millar, the best-selling writer of THE AUTHORITY and Wanted, comes this strangely different take on the Superman mythos. Featuring art by Dave Johnson, Kilian Plunkett, Andrew Robinson, and Walden Wong, with an introduction by film producer Tom DeSanto (X-Men, X2: X-Men United, Transformers), this edition also features an extensive sketch gallery by Johnson, Plunkett and Alex Ross.');
INSERT INTO `document` (`DocID`, `Title`, `Author`, `Publisher`, `PublishYear`, `Quantity`, `Tags`, `Visited`, `thesis`, `ISBN`, `Votes`, `Score`, `Cover`, `Description`) VALUES
(13, 'Tom and Jerry Meet Little Quack (Tom & Jerry)', NULL, 'Golden Books', 2021, 0, 'Juvenile Fiction', 0, 0, '9780593306444', 0, 0, , 'A delightful vintage Tom & Jerry(TM) Little Golden Book back in print after nearly 50 years! Tom the cat can\'t help but chase his old buddy Jerry. It\'s usually fun and games, but this time Jerry has his hands full with a lost baby duckling in search of its mother. The clever mouse will have to think of something quick to convince Tom to help him out. This Tom & Jerry Little Golden Book from 1953 is perfect for kids and collectors!');
INSERT INTO `document` (`DocID`, `Title`, `Author`, `Publisher`, `PublishYear`, `Quantity`, `Tags`, `Visited`, `thesis`, `ISBN`, `Votes`, `Score`, `Cover`, `Description`) VALUES
(14, 'Friends Forever', 'Panini Publishing', NULL, 2007, 0, 'Children\'s storie, American', 0, 0, '9781846530234', 0, 0, NULL, 'In \'Friends Forever\' find out what happens when Tom and Jerry become superheroes, see how Tom gets on with Jerry\'s new pet snake, and much more.'),
(15, 'Fifty Shades Trilogy', 'E. L. James', NULL, 2011, 0, 'Businessmen', 0, 0, '9780345803481', 0, 0, NULL, 'When Anastasia Steele, a young literature student, interviews wealthy young entrepreneur Christian Grey for her campus magazine, their initial meeting introduces Anastasia to an exciting new world that will change them both forever.');
INSERT INTO `document` (`DocID`, `Title`, `Author`, `Publisher`, `PublishYear`, `Quantity`, `Tags`, `Visited`, `thesis`, `ISBN`, `Votes`, `Score`, `Cover`, `Description`) VALUES
(16, 'Think Big', 'Grace Lordan', 'National Geographic Books', 2021, 0, 'Business & Economics', 0, 0, '9780241420164', 0, 0, , 'What are you doing today to make your dream future come true? \'A rare self-help book that\'s actually informed by evidence. A host of perceptive, practical tips for getting out of your own way and making progress toward your career goals.\' Adam Grant, bestselling author of Think Again and Originals \'A practical and accessible guide to using behavioural science in your career.\' Caroline Criado Perez, author of Invisible Women ________________­­­­­­­­­­­­­­­­­­­­­­­ We all have big ambitions for the future but those dreams only become reality if we do something towards them regularly. To achieve audacious goals, we need to take action and make small changes every day. We need to think big and act small. Drawing on cutting-edge research from behavioural science, Dr Grace Lordan offers immediate actionable solutions and tips that will help you get closer to your dream future, every day. Focusing on six key areas - your time, goal planning, self-narratives, other people, your environment, and resilience - Dr Lordan reveals practical, science-backed hacks that will help you get ahead. Each chapter introduces us to behavioural science concepts like the \'halo effect\', \'confirmation bias\', \'affect heuristic\' and the \'ostrich effect\', to help you better understand yourself and others, so that you can get the most out of your career. Whether you fantasise about changing industry, landing that big promotion, writing a screenplay or setting up your own company, Think Big creates a clear pathway to the future you want now. Some of the things you\'ll learn include how to: · Overcome a fear of failure and throw yourself at opportunity · Craft the optimum environment for work and give yourself ample time for tasks · Rewrite self-narratives and tackle imposter syndrome · Watch out for other people\'s biases and stop them from holding you back Think Big provides a practical framework to keep you moving in the right direction towards any goal. It will help you get out of your own way and propel you on the path to success, transforming you from dreamer to doer!');

